import { Route, Routes } from "react-router-dom";
import Global from "./components/Global/Global";
import Home from "./pages/Home";

function App() {
  return (
    <div>
      {}
      <Routes>
        <Route path="/" element={<Home />} />
        <Route path="/Covid/global" element={<global />} />
      </Routes>
    </div>
  );
}

export default App;
